//apply tanh(x) where x = fa6
//if -2 < x < 2  -> tanh = x - 0.25*x²*sign(x)
//else tanh=sign(x)
//tanh result stored in fa7
//must be called with jal a0, tanh_fa6


    //---- load address of floats to be used
    la t1, tanh_floats

